import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import NavBar from './navBar/NavBar.js';
import styles from './cssPage/potfolio.module.css';
import Container from 'react-bootstrap/Container';
import Intro from './sections/Intro.js';
import Button from 'react-bootstrap/esm/Button.js';
function App() {
  return (
    <BrowserRouter>
      <div className={styles.tagline} style={{ position: 'relative' }}>
        <img className="bgPic" src={'/image/bgImg.jpg'} alt="" />

        <div
          className={`${styles.container}  rounded`}
          style={{ position: 'absolute', top: 19, left: 70, width: '90vw' }}
        >
          <NavBar />
          <div style={{ position: 'absolute', top:120, left: 40, width: '' }}>
          <Intro />
        </div>

        <div style={{ position: 'absolute', top:398, left: 53, width: '' }}>
        <Button style={{borderRadius:"20px", width:"159px"}} variant='info' className='p-3'>
            Contact me
            </Button>
        <Button style={{borderRadius:"20px", width:"159px"}} variant='info' className='p-3'>
            Contact me
            </Button>
        </div>
        </div>

      </div>
    </BrowserRouter>
  );
}

export default App;
